import { NavLink } from "react-router-dom"

const Navbar = () => {
    return(
        <nav style={{color:"white"}}>
            <NavLink to="/">Schedule</NavLink>
            <NavLink to="/standings">Standings</NavLink>
            <NavLink to="/results">Results</NavLink>
        </nav>
    )
}

export default Navbar
